b="<INPUT type='RADIO' name='grp'>",Efb='<b>, and this the latitude<\/b> ',Dfb='<b>This is the longitude <\/b> ',$bb='<gwt:clipper style="',I9='<html><body onload="if(parent.__gwt_onHistoryLoad)parent.__gwt_onHistoryLoad(__gwt_historyToken.innerText)"><div id="__gwt_historyToken">',fcb="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",Ejb='<p><i>',meb='<p>Don\'t forget to add the following line to your HTML if you want to use Google V3. :<\/p><p><b>&lt;script src="http://maps.google.com/maps/api/js?v=3&amp;sensor=false"&gt;&lt;/script&gt;<\/b><\/p>',veb='<p>Don\'t forget to add the following line to your html file if you want to use OSM :<\/p><p><b>&lt;script src="http://www.openstreetmap.org/openlayers/OpenStreetMap.js"&gt;&lt;/script&gt;<\/b><\/p>',gib='<p>This example shows a few features rotating. There is not yet a control built that provides a tool for rotating, but the geometry.rotate method can be accessed to rotate programmatically.<\/p>',Rjb='<p>This example shows how highlight a feature on hover, so that after a click this highlighted feature gets selected.<p><p>Using this technique you can circumvent the fact that users have click exactly on a feature to select it.<\/p>',Sfb='<p>This example shows how to Drag A Vector Feature.<\/p>',aeb='<p>This example shows how to add Bing layers to GWT-OL.<\/p>',leb='<p>This example shows how to add Google V3 layers to GWT-OL.<\/p><p>If you use the Google Maps v3 API with a Google layer, you don\'t need to include an API key. This layer only works in the spherical mercator projection.<\/p><p><b>Note on Google Maps API versioning:<\/b> This example uses the "nightly" version of Google Maps API. This is specified by using v=3 in the the Google Maps API URL. Production applications should use the "release" or "frozen" versions of Google Maps API. See the OpenLayers.Layer.Google.v3 API docs, and the Versioning Section of the Google Maps API docs, for more details.<\/p>',khb='<p>This example shows how to add a KML layer to a map.<\/p>',Qhb='<p>This example shows how to add a Measure Control to the map.<\/p><p>Click on the map to add measure points, end a measurement using double click.<\/p><p>Note that you could add buttons to enable/disable the measure control on command.<\/p>',Neb='<p>This example shows how to add a TMS layer to GWT-OL.<\/p>',njb='<p>This example shows how to add a Vector marker, and a line to the map.<\/p><p>Note that you can also use the Marker class to add markers, but it is advised to use this method instead.',hkb='<p>This example shows how to add a WMS layer and a WFS overlay to a map.<\/p>',lkb="<p>This example shows how to add a WMS layer and a WFS overlay to a map.<\/p><p>By clicking on the WFS it can be reshaped.<\/p><p>It is also possible to save the modifications back to the server, this is however disabled in this example, but if you click the <b>''View source''<\/b> button you can see the source how this can be realised.",Bfb='<p>This example shows how to add a custom mouse position to the map..<\/p>',ueb='<p>This example shows how to add a some OSM layers to GWT-OL.<\/p>',Hhb='<p>This example shows how to display a marker on the users current location.<\/p><p>This actually just uses the GWT GeoLocation class and displays a marker on the returned location.',efb='<p>This example shows how to listen for clicks on the map, and display the clicked coordinates.<\/p>',Zhb='<p>This example shows how to refresh a WFS layer to the server state.<\/p><p>By clicking on the WFS it can be reshaped.<\/p><p>By clicking on refresh the original state is refreshed from the server.<\/p>',dkb='<p>This example shows how to refresh a WMS layer to its server state.<\/p><p>Clicking on the refresh button will refresh the layer, but since the WMS layer used is just a static map you will see nothing happen.You will just have to trust us that the code provide really does reload the WMS layer, or check network trafic :-)<\/p>',ufb="<p>This example shows how to use a CQL
